  constructor(private apiService : ApiService, private route: ActivatedRoute){

    this.route.url.subscribe(url => {

      const lastRoute = url[url.length - 1].path;
      this.numeroPedido = lastRoute

    });

    this.apiService.obtenerFichaPedido(this.numeroPedido).subscribe((res) => {

      this.fichaPedido = res

      if(!this.fichaPedido.error){

        this.controlPertenenciaCliente = true

      }

      if(this.controlPertenenciaCliente == false){
        this.mensajePedido = "Este pedido no existe."
      } else {
        this.mensajePedido = `Pedido #${this.numeroPedido}`
      }

      console.log(this.fichaPedido)

    });

    

  }

